function delAttr_rcl(prmName){
        var res = '';
        var d = location.href.split("#")[0].split("?");  
        var base = d[0];
        var query = d[1];
        if(query) {
                var params = query.split("&");  
                for(var i = 0; i < params.length; i++) {  
                        var keyval = params[i].split("=");  
                        if(keyval[0] !== prmName) {
                            if(i>0)res+='&';
                            res += params[i];
                                
                        }
                }
        }
        
        return base + '?' + res;
}
